/* Event structure for event `salesmanSignIn` */

/*!50106 DROP EVENT IF EXISTS `salesmanSignIn`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `salesmanSignIn` ON SCHEDULE EVERY 1 DAY STARTS '2017-10-20 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO # 开始该计划任务要做的事  
BEGIN  
  
  
-- do something 编写你的计划任务要做的事  
-- 1.每到晚上12点往业务员签到表里插入每个人的记录
INSERT INTO salesman_sign_in (salesmanId,`time`) SELECT id,DATE_FORMAT(NOW(),'%Y-%m-%d') FROM salesman; 
-- 结束计划任务  
END */$$
DELIMITER ;

/* Event structure for event `salesman_wallet` */

/*!50106 DROP EVENT IF EXISTS `salesman_wallet`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `salesman_wallet` ON SCHEDULE EVERY 1 DAY STARTS '2017-11-01 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO # 开始该计划任务要做的事  
BEGIN  
  
  
-- do something 编写你的计划任务要做的事  
-- 1.每到晚上12点往明细表里插入钱包余额的收益
INSERT INTO salesman_detail (salesman_id,`desc`,money,`time`,totalMoney)
 SELECT salesmanId,'收益',format((balance/10000)*1.1,2),DATE_SUB(CURDATE(),INTERVAL 1 DAY),balance+FORMAT((balance/10000)*1.1,2)
 FROM salesman_wallet WHERE balance>=1000;
-- 2.然后更新钱包里余额的数据
UPDATE salesman_wallet SET balance=balance+FORMAT((balance/10000)*1.1,2) , `time` = NOW() WHERE balance >=1000;
-- 3.插入存款收益金明细表，根据eeid，分组，直接插入该用户的所有存款的收益
INSERT INTO salesman_detail (salesman_id,`desc`,money,`time`,totalMoney)
SELECT salesman_id,'存款收益',format(1.3*SUM(nowMoney)/10000,2),DATE_SUB(CURDATE(),INTERVAL 1 DAY),SUM(nowMoney)+FORMAT(1.3*SUM(nowMoney)/10000,2) FROM  salesman_deposit
WHERE `status` ='未到期'   GROUP BY salesman_id  ;
-- 4.修改存款里的金额    
UPDATE salesman_deposit SET nowMoney = nowMoney+format(1.3*nowMoney/10000,2),TIME = NOW()
WHERE STATUS ='未到期';
-- 5.到期存款转入钱包，先插入明细表
INSERT INTO salesman_detail (salesman_id,`desc`,money,`time`,totalMoney)
SELECT d.salesman_id,'存款转出',nowMoney,NOW(),nowMoney+w.balance FROM salesman_deposit as d,salesman_wallet as w WHERE  DATE_FORMAT(endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d') AND d.salesman_id = w.salesmanId;
-- 6.到期存款转入钱包
UPDATE salesman_wallet AS w,
(SELECT salesman_id,SUM(nowMoney) AS sumNowMoney,endtime,`STATUS` FROM salesman_deposit WHERE DATE_FORMAT(endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d') AND STATUS = '未到期' GROUP BY salesman_id )AS d 
SET w.balance = w.balance + d.sumNowMoney  
WHERE w.salesmanId = d.salesman_id AND DATE_FORMAT(d.endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d') AND d.STATUS = '未到期';
-- 7.修改已到期的存款状态
UPDATE salesman_deposit AS d SET d.`time` = NOW(),d.STATUS='已转出'
WHERE  DATE_FORMAT(endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d');
-- 结束计划任务  
END */$$
DELIMITER ;

/* Event structure for event `test` */

/*!50106 DROP EVENT IF EXISTS `test`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `test` ON SCHEDULE EVERY 1 DAY STARTS '2017-09-13 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO # 开始该计划任务要做的事  
BEGIN  
  
  
INSERT INTO withdraw_deposit (eeid,`desc`,cash,`time`,totalMoney)
 SELECT eeid,'收益',(balance/10000)*1.1,DATE_SUB(CURDATE(),INTERVAL 1 DAY),balance+(balance/10000)*1.1
 FROM wallet WHERE balance>0;
UPDATE wallet SET balance=balance+(balance/10000)*1.1 , `time` = NOW() WHERE balance >0;
INSERT INTO withdraw_deposit (eeid,`desc`,cash,`time`,totalMoney)
SELECT eeid,'存款收益',1.3*SUM(nowMoney)/10000,DATE_SUB(CURDATE(),INTERVAL 1 DAY),SUM(nowMoney)+1.3*SUM(nowMoney)/10000 FROM  deposit
WHERE `status` ='未到期'   GROUP BY eeid  ;
UPDATE deposit SET nowMoney = nowMoney+1.3*nowMoney/10000,TIME = NOW()
WHERE STATUS ='未到期';
INSERT INTO withdraw_deposit (eeid,`desc`,cash,`time`,totalMoney)
SELECT d.eeid,'存款转出',nowMoney,NOW(),nowMoney+w.balance FROM deposit d,wallet w WHERE  DATE_FORMAT(endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d') AND d.eeid = w.eeid;
  UPDATE wallet AS w,
(SELECT eeid,SUM(nowMoney) AS sumNowMoney,endtime,`STATUS` FROM deposit WHERE DATE_FORMAT(endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d') AND STATUS = '未到期' GROUP BY eeid )AS d 
SET w.balance = w.balance + d.sumNowMoney  
WHERE w.eeid = d.eeid AND DATE_FORMAT(d.endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d') AND d.STATUS = '未到期';
UPDATE deposit AS d SET d.`time` = NOW(),d.STATUS='已转出'
WHERE  DATE_FORMAT(endtime,'%Y-%m-%d')=DATE_FORMAT(NOW(),'%Y-%m-%d');
END */$$
DELIMITER ;

/* Function  structure for function  `BASE64_DECODE` */

/*!50003 DROP FUNCTION IF EXISTS `BASE64_DECODE` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `BASE64_DECODE`(input BLOB) RETURNS blob
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN
    DECLARE ret BLOB DEFAULT '';
    DECLARE done TINYINT DEFAULT 0;
    IF input IS NULL THEN
        RETURN NULL;
    END IF;
each_block:
    WHILE NOT done DO BEGIN
        DECLARE accum_value BIGINT UNSIGNED DEFAULT 0;
        DECLARE in_count TINYINT DEFAULT 0;
        DECLARE out_count TINYINT DEFAULT 3;
each_input_char:
        WHILE in_count < 4 DO BEGIN
            DECLARE first_char CHAR(1);
            IF LENGTH(input) = 0 THEN
                RETURN ret;
            END IF;
            SET first_char = SUBSTRING(input,1,1);
            SET input = SUBSTRING(input,2);
            BEGIN
                DECLARE tempval TINYINT UNSIGNED;
                DECLARE error TINYINT DEFAULT 0;
                DECLARE base64_getval CURSOR FOR SELECT val FROM base64_data WHERE c = first_char;
                DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET error = 1;
                OPEN base64_getval;
                FETCH base64_getval INTO tempval;
                CLOSE base64_getval;
                IF error THEN
                    ITERATE each_input_char;
                END IF;
                SET accum_value = (accum_value << 6) + tempval;
            END;
            SET in_count = in_count + 1;
            IF first_char = '=' THEN
                SET done = 1;
                SET out_count = out_count - 1;
            END IF;
        END; END WHILE;
        -- We've now accumulated 24 bits; deaccumulate into bytes
        -- We have to work from the left, so use the third byte position and shift left
        WHILE out_count > 0 DO BEGIN
            SET ret = CONCAT(ret,CHAR((accum_value & 0xff0000) >> 16));
            SET out_count = out_count - 1;
            SET accum_value = (accum_value << 8) & 0xffffff;
        END; END WHILE;
    END; END WHILE;
    RETURN ret;
END */$$
DELIMITER ;

/* Function  structure for function  `BASE64_ENCODE` */

/*!50003 DROP FUNCTION IF EXISTS `BASE64_ENCODE` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `BASE64_ENCODE`(input BLOB) RETURNS blob
    DETERMINISTIC
    SQL SECURITY INVOKER
BEGIN
    DECLARE ret BLOB DEFAULT '';
    DECLARE done TINYINT DEFAULT 0;
    IF input IS NULL THEN
        RETURN NULL;
    END IF;
each_block:
    WHILE NOT done DO BEGIN
        DECLARE accum_value BIGINT UNSIGNED DEFAULT 0;
        DECLARE in_count TINYINT DEFAULT 0;
        DECLARE out_count TINYINT;
each_input_char:
        WHILE in_count < 3 DO BEGIN
            DECLARE first_char CHAR(1);
            IF LENGTH(input) = 0 THEN
                SET done = 1;
                SET accum_value = accum_value << (8 * (3 - in_count));
                LEAVE each_input_char;
            END IF;
            SET first_char = SUBSTRING(input,1,1);
            SET input = SUBSTRING(input,2);
            SET accum_value = (accum_value << 8) + ASCII(first_char);
            SET in_count = in_count + 1;
        END; END WHILE;
        -- We've now accumulated 24 bits; deaccumulate into base64 characters
        -- We have to work from the left, so use the third byte position and shift left
        CASE
            WHEN in_count = 3 THEN SET out_count = 4;
            WHEN in_count = 2 THEN SET out_count = 3;
            WHEN in_count = 1 THEN SET out_count = 2;
            ELSE RETURN ret;
        END CASE;
        WHILE out_count > 0 DO BEGIN
            BEGIN
                DECLARE out_char CHAR(1);
                DECLARE base64_getval CURSOR FOR SELECT c FROM base64_data WHERE val = (accum_value >> 18);
                OPEN base64_getval;
                FETCH base64_getval INTO out_char;
                CLOSE base64_getval;
                SET ret = CONCAT(ret,out_char);
                SET out_count = out_count - 1;
                SET accum_value = accum_value << 6 & 0xffffff;
            END;
        END; END WHILE;
        CASE
            WHEN in_count = 2 THEN SET ret = CONCAT(ret,'=');
            WHEN in_count = 1 THEN SET ret = CONCAT(ret,'==');
            ELSE BEGIN END;
        END CASE;
    END; END WHILE;
    RETURN ret;
END */$$
DELIMITER ;

